import { Route, Switch } from "react-router-dom";

import Welcome from "./components/pages/Welcome";

function App() {
  return (
      <Switch>
        <Route path="/quotes" exact></Route>
        <Route path="/welcome">
          <Welcome />
        </Route>
      </Switch>
  );
}

export default App;
